import React from "react";
import { useForm } from "@mantine/hooks";
import { TextInput } from "@mantine/core";

const SignUpForm = () => {
  const form = useForm({
    initialValues: {
      firstName: "",
      lastName: "",
      username: "",
      email: "",
      password: "",
      confirmPassword: "",
    },
  });
  return (
    <div>
      <form>
        <TextInput placeholder="First Name" />
      </form>
    </div>
  );
};

export default SignUpForm;
